// 方法:
// 使用自定义hash, 这样能O(n)对s的所有长度为l的子串进行hash
// 然后类似字母匹配的方式, 将间隔为l的子串视为字母, 进行匹配
class Solution {
public:
    vector<int> findSubstring(string s, vector<string>& words) {
        if(words.size() == 0 || s.size() == 0)
            return vector<int>();
        int W = words.size();
        int L = words[0].size();
        if(s.size() < L*W)
            return vector<int>();

        unordered_map<string_view, int> wcount;
        using UMIT = unordered_map<string_view, int>::iterator;
        for(auto &i : words)
            wcount[string_view(&i[0], L)]++;

        vector<UMIT> ss;
        ss.resize(s.size());
        for(int i = 0; i <= ss.size()-L; i++)
            ss[i] = wcount.find(string_view(&s[i], L));

        vector<int> rlt;
        for(int i = 0; i < L; i++) {
            int num = wcount.size();
            int b = i, e = i;
            for(int j = 0; j < W && e < ss.size(); j++) {
                if(ss[e] != wcount.end()) {
                    switch((ss[e]->second)--) {
                    case 0: num++; break;
                    case 1: num--; break;
                    }
                }
                e += L;
            }
            if(num == 0)
                rlt.emplace_back(b);
            while(e < ss.size()) {
                if(ss[b] != wcount.end()) {
                    switch(++(ss[b]->second)) {
                    case 0: num--; break;
                    case 1: num++; break;
                    }
                }
                if(ss[e] != wcount.end()) {
                    switch((ss[e]->second)--) {
                    case 0: num++; break;
                    case 1: num--; break;
                    }
                }
                b += L, e += L;
                if(num == 0)
                    rlt.emplace_back(b);
            }
            for(; b != e; b += L)
                if(ss[b] != wcount.end())
                    ++(ss[b]->second);
        }
        return rlt;
    }
};

